import React, { Component } from 'react';
import './contact.css';
import { Grid, Cell } from 'react-mdl';
import PatrikContact from '../assets/contact-patrik.png'
import {List,ListItem,ListItemContent} from 'react-mdl';

class Contact extends Component {
    render(){
        return(
            <div className="contact-container">

                <Grid className="contact-grid">

                    <Cell col={6}>
                       <h2>Patrik Hogler</h2>
                       <img src={PatrikContact} 
                            alt="Photo of Patrik Hogler"
                            style={{ height: '250px', borderRadius: '50%'}}

                       ></img>
                       <p style={{width:'75%', margin:'auto', paddingTop: '2em'}}>Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry's standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book.</p>
                    </Cell>

                    <Cell col={6}>
                    <div className="contact-list">
                        <h2>Contact me</h2>
                        <hr className="contact-breakline"></hr>
                        <List>
                        <ListItem>
                            <ListItemContent><i class="fas fa-envelope-square"></i>Bryan Cranston</ListItemContent>
                        </ListItem>
                        <ListItem>
                            <ListItemContent icon="person">Aaron Paul</ListItemContent>
                        </ListItem>
                        <ListItem>
                            <ListItemContent icon="person">Bob Odenkirk</ListItemContent>
                        </ListItem>
                        </List>
                    </div>
                    </Cell>
                </Grid>

            </div>
        )
    }
}

export default Contact;
